  public tinhArr: any[] = [];
  public tinhArr1: any[] = [];
  public tinhArrQuan: any[] = [];
  public tinhArrQuan1: any[] = [];
  public tinhArrXa: any[] = [];
  public tinhArrXa1: any[] = [];
  public data1: any[] = [];
  public objCart: any;
  constructor(public dataService: DataService, public formBuilder: FormBuilder, public firebaseService: FirebaseService) { }

  ngOnInit(): void {
    this.profileForm = this.formBuilder.group({
      fullName: ['', Validators.required],
      phoneNumber: ['', [Validators.required, Validators.minLength(10)]],
      yourEmail: ['', [Validators.email, Validators.required]],
      addressTinh: ['', Validators.required],
      addressHuyen: ['', Validators.required],
      addressXa: ['', Validators.required],
      addressDetails: ['', Validators.required],
      note: ['']
    });
    this.tinhArr = this.provinceData.map(item => {
      return item.tinh;
    });
    this.tinhArr1 = [this.tinhArr[0]];
    const tinhArrLength = this.tinhArr.length;
    for (let i = 1; i < tinhArrLength; i++) {
      if (this.tinhArr[i] !== this.tinhArr[i - 1]) {
        this.tinhArr1.push(this.tinhArr[i]);
      }
    }
  }
  public onSubmit(): any {
    // console.log(this.profileForm.value);
    this.dataService.dataInfoCustomer$.next(this.profileForm.value);
    this.sold();
  }

  public getDataQuanHuyen(): any {
    // console.log((this.tinh));
    this.tinhArrQuan = this.provinceData.filter(item => {
      return item.tinh === this.tinh;
    });
    this.tinhArrQuan1 = [];
    // this.tinhArrQuan[0].huyen
    const tinhArrQuanLength = this.tinhArrQuan.length;
    for (let i = 1; i < tinhArrQuanLength; i++) {
      if (this.tinhArrQuan[i].huyen !== this.tinhArrQuan[i - 1].huyen) {
        this.tinhArrQuan1.push(this.tinhArrQuan[i].huyen);
      }
    }
    // console.log(this.tinhArrQuan1);
  }

  public getDataQuanXa(): any {
    // console.log((this.huyen));
    this.tinhArrXa = this.provinceData.filter(item => {
      return item.huyen === this.huyen;
    });
    this.tinhArrXa1 = [];
    // this.tinhArrXa[0].xa
    const tinhArrXaLength = this.tinhArrXa.length;
    for (let i = 1; i < tinhArrXaLength; i++) {
      if (this.tinhArrXa[i].xa !== this.tinhArrXa[i - 1].xa) {
        this.tinhArrXa1.push(this.tinhArrXa[i].xa);
      }
    }
    // console.log(this.tinhArrXa1);
  }

  public sold(): any {
    let d = new Date();
    // console.log(d.toUTCString());
// Wed, 22 Dec 2021 00:31:25 GMT
    let dayofweek = d.getDay();
    const dayname = ['CN','T2','T3','T4','T5','T6','T7'];
    const timeCart = dayname[dayofweek] + ' ngày '+ d.getDate() + '/' + (d.getMonth() + 1)+ '/'+ d.getFullYear()+  '/'+ d.getHours()+':'+d.getMinutes()+':'+d.getSeconds();
    setTimeout(() => {
      this.dataService.newArrIdNew2.forEach((item: any) => {
        this.data1.push('Tên sản phẩm: ');
        this.data1.push(item.productDetails.name);
        this.data1.push('Số lượng: ');
        this.data1.push(item.count);
      });
      const data2 = this.data1.join();
      console.log('data2', data2);
      const templateParams = {
        to_name: 'nguyenhongson.bk@gmail.com',
        from_name: this.dataService.dataInfoCustomer[0].yourEmail,
        fullName: this.dataService.dataInfoCustomer[0].fullName,
        phoneNumber: this.dataService.dataInfoCustomer[0].phoneNumber,
        yourEmail: this.dataService.dataInfoCustomer[0].yourEmail,
        addressTinh: this.dataService.dataInfoCustomer[0].addressTinh,
        addressHuyen: this.dataService.dataInfoCustomer[0].addressHuyen,
        addressXa: this.dataService.dataInfoCustomer[0].addressXa,
        addressDetails: this.dataService.dataInfoCustomer[0].addressDetails,
        note: this.dataService.dataInfoCustomer[0].note,
        nameItem1: data2,
      };
      this.dataService.newArrIdNew2.forEach((item: any) => {
          item.infoCustomer = templateParams;
          item.timeCart = timeCart;
      });


      console.log(templateParams);
      emailjs.send('service_rlr6cto', 'template_ig9l7ay', templateParams)
        .then(function(response) {
          console.log('SUCCESS!', response.status, response.text);
        }, function(error) {
          console.log('FAILED...', error);
        });
      alert('Bạn đã đặt hàng thành công ! Công ty sẽ liên lạc sớm với bạn để xác nhận.');
      this.objCart = Object.assign({}, this.dataService.newArrIdNew2);
      // console.log('this.objCart',  this.objCart);
      // console.log('this.template',  templateParams);
      // console.log('this.dataService.newArrIdNew2:', this.dataService.newArrIdNew2);

      this.firebaseService.createFunctionalityListCart(this.objCart, '/cart');
    }, 300);


  }


